import Form from "./form";
import React, { useState } from "react";

function AddressList() {
  const [AddressType, setAddressType] = useState("Personal");
  const [addressList, setAddressList] = useState([
    {
      name: "Ankit",
      mobileNumber: "123456",
      address: "sdfgsds",
      state: "fgdfhdf",
      city: "dfghd",
      postalCode: "134",
      addressStatus: "present",
      addressType: "Personal",
    },
    {
      name: "Fasttrack",
      mobileNumber: "123456",
      address: "sdfgsds",
      state: "fgdfhdf",
      city: "dfghd",
      postalCode: "134",
      addressStatus: "present",
      addressType: "Business",
    }
]);

  const onTabChange = (event) => {
    setAddressType(event.target.value);
  };

  return (
    <React.Fragment>
      <div>
        <button className="add">Add</button>
      </div>
      <div>
        <table>
          <tr>
            <th className="buttons" value="Personal">
              Personal
            </th>
            <th className="buttons" value="Business">
              Business
            </th>
          </tr>
          <tr>
            <th>Name</th>
            <th>Mobile No.</th>
            <th>Address</th>
            <th>City</th>
            <th>State</th>
            <th>Zip</th>
            <th>Present/Permanent</th>
          </tr>
          <tr>
            {addressList.map((addr) => {
              addr.addressType === AddressType && (
                <div>
                  <td>addr.name</td> <td>addr.mobileNumber</td>
                  <td>addr.address</td>
                </div>
              );
            })}
          </tr>
        </table>
      </div>
    </React.Fragment>
  );
}

export default AddressList;
